import './App.css';
import Header from './Header';
import List from './List';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Route path='/tasks'>
        <div className='app' style={{ marginTop: '2rem' }}>
          <Header />
          <List />
        </div>
      </Route>
    </BrowserRouter>
  );
}

export default App;
